import React from "react";
import ExpenseItem from "./ExpenseItem";

const Expenses = () => {
    var expenseList = [
        {
            id: 'e1',
            title: 'Toilet Paper',
            amount: 94.12,
            date: new Date(2020, 7, 14),
          },
          { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
          {
            id: 'e3',
            title: 'Car Insurance',
            amount: 294.67,
            date: new Date(2021, 2, 28),
          },
          {
            id: 'e4',
            title: 'New Desk (Wooden)',
            amount: 450,
            date: new Date(2021, 5, 12),
          }
    ]

    return (
        <div>
            <ExpenseItem title = {expenseList[0].title} amount = {expenseList[0].amount} date = {expenseList[0].date.toISOString()} />

        </div>
    )
}

export default Expenses;
